  return (
    <div className="light-background">
      <Header isLight={true} />
      <CaseStudy
        title="New Hel.fi"
        subtitle="Citizen-centric renewal of the largest website in Finland"
        services="UX/UI, Development"
        client="City of Helsinki"
        year="2020-2022"
        background="The city of Helsinki's hel.fi was serving as one of the largest websites in Finland..."
        challenge="The challenge was to create a user-friendly and accessible website..."
        approach="We focused on translating the Helsinki brand into a digital experience..."
        solution="The new Hel.fi website features a clean, modern design..."
        images={[/* array of image URLs */]}
      />
    </div>
  );
}

export default CaseStudyHel;
